import styled from 'styled-components'
import { Link } from "react-router-dom";


const StyledNavbar=styled.nav`
 margin:0;
height:64px;
color: black ;
background: #022541;
display : flex;
flex-direction: row;
align-items: center;
justify-content:space-between;
@media (max-width: 768px) {
    flex-direction: column;
  }
  `;

const StyledDiv=styled.di


export const Navbar=(probs)=>{

    return(
 <StyledNavbar>
     {probs.children}
 </StyledNavbar>      
    )
}
